import React from "react";

const Contact = () => {
    return (
        <div className="mainText">
           <h1>Hello This is contact page</h1> 
           <a href="https://www.facebook.com/dato.malutashvili.9">Facebook Profile Link</a>
           <br />
           <a href="https://www.linkedin.com/in/dato-malutashvili-14b2691a4/">Linkedin Profile Link</a>
           <p>Phone Number: 555-5550-555</p>
        </div>
    )
}
export default Contact;
